import React from "react";
import "./NavBarItem.css";

const NavBarItem = (props) => {
  const data = [
    {
      type: "Stays",
      icon: "fa-bed",
      active: true,
    },
    {
      type: "Flights",
      icon: "fa-plane",
      active: false,
    },
    {
      type: "Car rentals",
      icon: "fa-car",
      active: false,
    },
    {
      type: "Attractions",
      icon: "fa-bed",
      active: false,
    },
    {
      type: "Airport taxis",
      icon: "fa-taxi",
      active: false,
    },
  ];

  const item = data.map((item) => {
    return (
      <div>
        <li>
          <i className={`fa ${item.icon}`}></i>
          {item.type}
        </li>
      </div>
    );
  });
  return item;
};

export default NavBarItem;
